import React, { useState } from "react";
import "./App.css";
import MovieCard from "./components/movieCard";
import Search from "./components/Search";
import Addmovie from "./components/Addmovie";
import RatingMovie from "./components/ratingMovie";
function App() {
  const [movieList, setmovieList] = useState([
    {
      img:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSx4aSwneIhkWRfhWUeM3iu3TzZE8zV97cYBQ&usqp=CAU",
      title: "Contagion",
      rating: 4,
    },
    {
      img:
        "data:image/jpeg;base64,",
      title: "Joker",
      rating: 3,
    },
    {
      img:
        "data:image/jpeg;base64,",
      title: "Gladiator",
      rating: 5,
    },
    {
      img:
        "data:image/jpeg;base64,",
      title: "transporter",
      rating: 4,
    },
    {
      img:
        "data:image/jpeg;base64,",
      title: "Avatar",
      rating: 4,
    },
    {
      img:
        "data:image/jpeg;base64,",
      title: "Twilight",
      rating: 5,
    },
    {
      img: "https://images5.alphacoders.com/523/thumb-350-523395.jpg",
      title: "Iron Man",
      rating: 4,
    },
    {
      img: "https://images5.alphacoders.com/697/thumb-350-697989.jpg",
      title: "Suicide squad",
      rating: 3,
    },
  ]);

  const search = (k) => {
    let x = movieList.filter(
      (el, index) => el.title.toLowerCase().indexOf(k.trim()) > -1
    );
    setmovieList(x);
  };

  const searchByRating = (n) => {
    let x = movieList.filter((el, index) => el.rating >= n);
    setmovieList(x);
  };

  const addNewMovie = movie => {
    let x = movieList.concat(movie);
    setmovieList(x);

    
  };

  return (
    <div className="App">
      <div className='top-bar'>
        <Search search={(s) => search(s)} />
        <RatingMovie numberStars={(n) => searchByRating(n)} />
        <Addmovie addMovie={newMovie => addNewMovie(newMovie)} />
      </div>
      <MovieCard movieList={movieList} />
    </div>
  );
}

export default App;
